import './App.css';
import HomePage from './pages/HomePage/HomePage';
import { BrowserRouter as Router, Routes, Route, Link } from 'react-router-dom';

function App() {
  return (
    <div className="App">
      <Router>
          <Routes>
            <Route path={"/home"} element={<HomePage />} /> 
          </Routes>

      </Router>

    </div>
  );
}

export default App;
